    dataIndex: "SDT",
  },
  {
    title: "Giới tính",
    key: "GioiTinh",
    dataIndex: "GioiTinh",
  },
  {
    title: "Email",
    key: "Email",
    dataIndex: "Email",
  },
];

const data = [
  {
    MaKH: "NV000000001",
    TenNV: "Lương Long Hà",
    NgayBD: "14/07/2021",
    LuongHT: "20000000",
    GhiChu: "Self Destruc activated",
  },
  {
    MaNV: "NV000000002",
    TenNV: "Nguyễn Trọng Khang",
    NgayBD: "09/01/2021",
    LuongHT: "30000000",
    GhiChu: "It's High Noonnnnn",
  },
  {
    MaNV: "NV000000003",
    TenNV: "Trần Khánh Gia Uy",
    NgayBD: "23/08/2020",
    LuongHT: "40000000",
    GhiChu: "An anomaly!",
  },
  {
    MaNV: "NV000000004",
    TenNV: "Đỗ Minh Khoa",
    NgayBD: "02/09/2021",
    LuongHT: "40000000",
    GhiChu: "Beep boop beep boop",
  },
];

function LuongNVQLK() {
  return (
    <div>
      <Layout>
        <Content>
          <Title level={2} classname="titlename">
            Danh sách khách hàng
          </Title>

          <Table columns={columns} dataSource={data} />
        </Content>
      </Layout>
    </div>
  );
}

export default LuongNVQLK;
